PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?date WHERE {
  fb:m.093xn8 fb:tv.tv_character.appeared_in_tv_program ?perf .
  ?perf fb:tv.regular_tv_appearance.from ?date
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?cause WHERE {
  fb:m.01w2x6z fb:people.deceased_person.cause_of_death ?cause
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?championship WHERE {
  fb:m.0jnq8 fb:sports.sports_team.championships ?championship
}
ORDER BY DESC ( ?championship )
LIMIT 1

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?character ?characterLabel WHERE {
  VALUES ?character {
    fb:m.03n6jv fb:m.03pcvr fb:m.02m29p fb:m.01sxhc
  }
  .
  ?character rdfs:label ?characterLabel FILTER ( LANG( ?characterLabel ) = 'en' )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?child ?childLabel ?place ?placeLabel WHERE {
  VALUES ?child {
    fb:m.0ggl36p fb:m.0j5dh53
  }
  .
  ?child rdfs:label ?childLabel FILTER ( LANG( ?childLabel ) = 'en' ) .
  ?child fb:people.person.place_of_birth ?place .
  ?place rdfs:label ?placeLabel
  FILTER ( LANG( ?placeLabel ) = 'en' )
}

