PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?player ?playerName ?from ?to WHERE {
  fb:m.04vn5 fb:sports.sports_team.roster ?roster .
  ?roster fb:sports.sports_team_roster.number "22" .
  ?roster fb:sports.sports_team_roster.player ?player .
  ?player rdfs:label ?playerName
  FILTER ( LANG( ?playerName ) = 'en' ) .
  OPTIONAL {
    ?roster fb:sports.sports_team_roster.from ?from
  }
  .
  OPTIONAL {
    ?roster fb:sports.sports_team_roster.to ?to
  }
}
ORDER BY DESC ( ?from )

