PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?type ?label WHERE {
  {
    fb:m.0f4vbz fb:people.person.profession ?profession .
    ?profession rdfs:label ?label
    FILTER ( LANG( ?label ) = 'en' ) BIND( 'Profession' AS ?type )
  } UNION {
    fb:m.0f4vbz fb:film.actor.film ?perf .
    ?perf fb:film.performance.film ?film .
    ?film rdfs:label ?label
    FILTER ( LANG( ?label ) = 'en' ) BIND( 'Actor' AS ?type )
  } UNION {
    fb:m.0f4vbz fb:film.director.film ?film .
    ?film rdfs:label ?label
    FILTER ( LANG( ?label ) = 'en' ) BIND( 'Director' AS ?type )
  }
}
LIMIT 20

