SELECT ?actor ?actorLabel WHERE {
  fb:m.06yykb fb:film.film.starring ?perf .
  ?perf fb:film.performance.character fb:m.02ph41w .
  ?perf fb:film.performance.actor ?actor .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel FILTER ( LANG( ?actorLabel ) = 'en' )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?latitude ?longitude ?country WHERE {
  fb:m.0ff0d fb:location.location.geolocation ?geocode .
  ?geocode fb:location.geocode.latitude ?latitude .
  ?geocode fb:location.geocode.longitude ?longitude .
  OPTIONAL {
    fb:m.0ff0d fb:location.location.containedby ?country .
    ?country rdfs:label ?country_label .
    FILTER ( LANG( ?country_label ) = 'en' )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?spouse ?label WHERE {
  fb:m.0hz_1 fb:people.person.spouse_s ?spouse_or_marriage .
  OPTIONAL {
    ?spouse_or_marriage fb:people.marriage.spouse ?spouse .
  }
  BIND( COALESCE ( ?spouse , ?spouse_or_marriage ) AS ?final_spouse ) .
  ?final_spouse rdfs:label ?label FILTER ( LANG( ?label ) = 'en' ) FILTER ( ?final_spouse != fb:m.0hz_1 )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?endDate WHERE {
  fb:m.07_nf fb:time.event.end_date ?endDate
