  ?performance fb:tv.regular_tv_appearance.character fb:m.035szd .
  ?performance fb:tv.regular_tv_appearance.actor ?actor .
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?coach ?label WHERE {
  {
    fb:m.01y3c fb:american_football.football_team.current_head_coach ?coach .
  } UNION {
    fb:m.01y3c fb:american_football.football_team.historical_coaching_staff ?pos .
    ?pos fb:american_football.football_historical_coach_position.coach ?coach .
  }
  ?coach rdfs:label ?label FILTER ( LANG( ?label ) = 'en' )
}

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?notable ?notable_label ?prof ?prof_label WHERE {
  fb:m.083pr fb:common.topic.notable_for ?notable .
  ?notable fb:common.notable_for.notable_object ?notable_obj .
  ?notable_obj rdfs:label ?notable_label
  FILTER ( LANG( ?notable_label ) = 'en' ) .
  OPTIONAL {
    fb:m.083pr fb:people.person.profession ?prof .
    ?prof rdfs:label ?prof_label
    FILTER ( LANG( ?prof_label ) = 'en' )
  }
}

PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT ?realName WHERE {
